import React from "react";
import styled from "styled-components";

const Container = styled.div`
  border: 2px solid black;
  width: 70%;
`;

const TeamInfo = () => {
  return (
    <Container>
      <h1>Team Name: Chelsea FC</h1>
    </Container>
  );
};

export default TeamInfo;
